Por motivos históricos, você pode passar uma string como primeiro argumento de setTimeout() e 
setInterval(). Se fizer isso, a string será avaliada (assim como acontece com eval()) após o tempo-
-limite ou o intervalo especificado. A especificação HTML5 (e todos os navegadores, exceto o IE) 
permitem argumentos adicionais para 
setTimeout() e setInterval(), após os dois primeiros. Quais-
quer desses argumentos são passados para a função chamada. Entretanto, se for exigida portabilidade 
com o IE, esse recurso não deve ser usado.

